[{"location":"#Geometry-Generation","page":"About","title":"Geometry Generation","text":"","category":"section"},{"location":"","page":"About","title":"About","text":"Documentation for functions used to generate potential geometry during the population growth in the genetic algorithm optimization.","category":"page"},{"location":"","page":"About","title":"About","text":"CurrentModule = geometry_configuration","category":"page"},{"location":"","page":"About","title":"About","text":"load_JSON()\r\nget_vertices(x1_coordinate_slider, x2_coordinate_slider, plane, L, W, T, R, shape)\r\nset_plane(plane, L, W, T)\r\nrectangle_vertices(x1_coordinate_slider, x2_coordinate_slider, plane, L, W, T)\r\ntriangle_vertices(x1_coordinate_slider, x2_coordinate_slider, W, L)\r\ncircle_vertices(x1_coordinate_slider, x2_coordinate_slider, R) \r\nplace_shape(x1_coordinate_slider, x2_coordinate_slider, plane, L, W, T, R, shape)","category":"page"},{"location":"#geometry_configuration.load_JSON-Tuple{}","page":"About","title":"geometry_configuration.load_JSON","text":"load_JSON()\n\nload the configuration and geometry json files. note that the radius, length, width, and thickness must be followed by the  value set for \"scaling_factor\" in the configuration.json file all keys must be present for all shapes\n\nExpected Formatting for 2 shape geometry input\n[\n                {\n                    \"shape\": \"Rod\",\n                    \"radius\": 100e-9,\n                    \"length\": 100e-9,\n                    \"width\": 100e-9,\n                    \"thickness\": 100e-9,\n                    \"material\": \"gold\",\n                    \"position\": [201.4, 101.1, 249.1]\n                },\n                {\n                    \"shape\": \"Rod\",\n                    \"radius\": 100e-9,\n                    \"length\": 100e-9,\n                    \"width\": 100e-9,\n                    \"thickness\": 100e-9,\n                    \"material\": \"gold\",\n                    \"position\": [201.4, 101.1, 249.1]\n                }\n]\n\nGeometry Keys:\n    \"shape\": Expected values: \"Rod\", \"Rectangle\", or \"Triangle\"\n    \"radius\": radius of rod in the XZ-plane\n        can be any positive floating point number\n    \"length\": number of units material spans along the Z-axis\n        can be any positive floating point number\n    \"width\": number of units material spans along the X-axis\n        can be any positive floating point number\n    \"Thickness\": number of units material spans along the Y-axis\n        can be any positive floating point number\n    \"material\": defines the color of the shape in the visualizer\n        currently the only defined colors are blue for \"air\"\n        and red for any other value\n    \"position\": coordinateds for the center of the shape in\n        a three value ordered pair, can be any positive float\n\nExpected Formatting for 2 shape geometry input\n            [\n                {\n                    \"scaling_factor\": 1E9,\n                    \"x_span\": 450,\n                    \"y_span\": 300,\n                    \"z_span\": 900\n                }\n            ]\n\nConfiguration Keys:\n    \"scaling_factor\": corresponds to the units of the geometry value\n    \"x_span\": sets the maximum value of the slider for the x-coordinate\n    \"y_span\": sets the maximum value of the slider for the y-coordinate\n    \"z_span\": sets the maximum value of the slider for the z-coordinate\n\n\n\n\n\n","category":"method"},{"location":"#geometry_configuration.get_vertices-NTuple{8, Any}","page":"About","title":"geometry_configuration.get_vertices","text":"get_vertices(x1_coordinate_slider, x2_coordinate_slider, plane, L, W, T, R, shape)\n\n\n\n\n\n","category":"method"},{"location":"#geometry_configuration.set_plane-NTuple{4, Any}","page":"About","title":"geometry_configuration.set_plane","text":"set_plane(plane, L, W, T)\n\n\n\n\n\n","category":"method"},{"location":"#geometry_configuration.rectangle_vertices-NTuple{6, Any}","page":"About","title":"geometry_configuration.rectangle_vertices","text":"rectangle_vertices(x1_coordinate_slider, x2_coordinate_slider, plane, L, W, T)\n\n\n\n\n\n","category":"method"},{"location":"#geometry_configuration.triangle_vertices-NTuple{4, Any}","page":"About","title":"geometry_configuration.triangle_vertices","text":"triangle_vertices(x1_coordinate_slider, x2_coordinate_slider, W, L)\n\n\n\n\n\n","category":"method"},{"location":"#geometry_configuration.circle_vertices-Tuple{Any, Any, Any}","page":"About","title":"geometry_configuration.circle_vertices","text":"circle_vertices(x1_coordinate_slider, x2_coordinate_slider, R)\n\n\n\n\n\n","category":"method"},{"location":"#geometry_configuration.place_shape-NTuple{8, Any}","page":"About","title":"geometry_configuration.place_shape","text":"place_shape(x1_coordinate_slider, x2_coordinate_slider, plane, L, W, T, R, shape)\n\n\n\n\n\n","category":"method"}]
